run_name: spes_moe_3b_9b_4nodes_norm_router
seed: 6198
dry_run: false
no_pre_train_checkpoint: true

wandb:
  name: ${run_name}
  project: spes
  group: null
  log_interval: 1

model:
  d_model: 2048
  mlp_ratio: 6
  n_heads: 16
  n_kv_heads: 8
  n_layers: 28
  weight_tying: false
  alibi: false
  rope: true
  rope_theta: 1000000
  flash_attention: true
  attention_dropout: 0.0
  attention_layer_norm: true
  include_bias: false
  block_type: moe
  layer_norm_type: rms
  layer_norm_eps: 1e-6
  layer_norm_with_affine: true
  bias_for_layer_norm: false
  attention_layer_norm_with_affine: true
  attention_layer_norm_over_head: true
  activation_type: swiglu
  residual_dropout: 0.0
  embedding_dropout: 0.0
  max_sequence_length: 4096
  vocab_size: 151665
  embedding_size: 151936
  eos_token_id: 151643
  pad_token_id: 151643
  init_device: meta
  init_fn: normal
  init_std: 0.02
  init_cutoff_factor: 3
  using_custom_moe_impl: true
  moe_log_expert_assignment: true
  moe_top_k: 2
  moe_num_experts: 8
  moe_dropless: true
  moe_mlp_impl: sparse
  moe_zloss_weight: 0.001
  moe_loss_weight: 0.01
  moe_normalize_expert_weights: true

compile: null

softmax_auxiliary_loss: true
auxiliary_loss_multiplier: 1e-5
fused_loss: true

using_spes: true

spes_config:
  num_peers: 8
  peer_id: 0
  num_train_experts_per_node: 2
  sync_steps: 100
  # replace with your server address and port
  server_addr: 127.0.0.1:50051
  using_decayed_aux_loss: false


optimizer:
  name: adamw
  learning_rate: 1.0e-4
  eps: 1.0e-8
  weight_decay: 0.1
  decay_norm_and_bias: true
  decay_embeddings: true
  betas:
  - 0.9
  - 0.95
  metrics_log_interval: 200

scheduler:
  name: cosine_with_warmup
  units: steps
  t_warmup: 1000
  t_max: 100000
  alpha_f: 0.1

tokenizer:
  identifier: Qwen/Qwen2.5-0.5B
  truncate_direction: right

save_folder: output/${run_name}/node${spes_config.peer_id}
save_overwrite: false

save_interval: 1000
save_interval_ephemeral: null
save_num_checkpoints_to_keep: 2
sharded_checkpointer: torch_new

# save_interval_unsharded: 10000
# save_num_unsharded_checkpoints_to_keep: 5

load_path: null

max_duration: 200000
stop_at: 200000
global_train_batch_size: 256
device_train_microbatch_size: 1

precision: amp_bf16
distributed_strategy: fsdp

fsdp:
  wrapping_strategy: by_block
  precision: mixed
  sharding_strategy: FULL_SHARD

# activation_checkpointing: fine_grained

max_grad_norm: 1.0
max_grad_norm_ratio: null

speed_monitor:
  window_size: 1

eval_interval: 1000
eval_subset_num_batches: -1
device_eval_batch_size: 2
evaluators:

  ##########################
  # Downstream evaluations #
  ##########################
  - label: piqa
    type: downstream

  - label: winogrande
    type: downstream
 
  - label: sciq
    type: downstream

  - label: arc_easy
    type: downstream

  - label: arc_challenge
    type: downstream

  - label: social_iqa
    type: downstream

  - label: basic_arithmetic
    type: downstream

  - label: gsm8k_gold_bpb_5shot
    type: downstream

  - label: mmlu_stem_mc_5shot_test
    type: downstream

  - label: mmlu_humanities_mc_5shot_test
    type: downstream

  - label: mmlu_social_sciences_mc_5shot_test
    type: downstream

  - label: mmlu_other_mc_5shot_test
    type: downstream


data:
  pad_direction: right
  seed: 6198
  num_workers: 12
  drop_last: true
  pin_memory: true
  prefetch_factor: 8
  persistent_workers: true
  memmap_dtype: uint32
  timeout: 0
  instance_filter:
      repetition_max_period: 13
      repetition_min_period: 1
